モビベルとは、ドローインという「腹を凹ませる」という動きを学習できるベルトです。ドローインとはスポーツ選手のトレーニングに取り入れられている技術の一つです。また、強・中・弱・3段階の強度調整も出来るため、自分に合ったドローインが可能となりました。<table width="300" border="0" cellspacing="0" cellpadding="0"><tr><br /><td><font color="#333333" size="-1">モビベルは「ドローイン」というお腹を凹ませて行うダイエットやトレーニングをサポートしてくれるベルトです。日々のエクササイズやトレーニングでなかなか成果がでない方や、まんまる猫背を治したい・引き締まったくびれを手に入れたいとお悩みのあなたにオススメです。ウエストに巻いて、日常生活を送るだけ。「ドローイン」を学んで、美姿勢を手に入れよう！！</font></td><br /></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><br /><tr bgcolor="#FFFFFF"><br /><td width="25%" align="center" bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td><br /><td width="75%" align="left"><font color="#333333" size="-1">ウエストサイズ：55～108cm<br>個装サイズ：20&times;16&times;3cm</font></td><br /></tr><tr bgcolor="#FFFFFF"><br /><td align="center" bgcolor="#FFFFCC"><font color="#333333" size="-1">重量</font></td><br /><td align="left"><font color="#333333" size="-1">30g<br>個装重量：115g</font></td><br /></tr><tr bgcolor="#FFFFFF"><br /><td align="center" bgcolor="#FFFFCC"><font color="#333333" size="-1">素材・材質</font></td><br /><td align="left"><font color="#333333" size="-1">本体：ABS・POM<br>外装：PET</font></td><br /></tr><tr bgcolor="#FFFFFF"><br /><td align="center" bgcolor="#FFFFCC"><font color="#333333" size="-1">付属品</font></td><br /><td align="left"><font color="#333333" size="-1">オリジナルメニューDVD、マニュアル</font></td><br /></tr><tr bgcolor="#FFFFFF"><br /><td align="center" bgcolor="#FFFFCC"><font color="#333333" size="-1">製造国</font></td><br /><td align="left"><font color="#333333" size="-1">中国</font></td></tr></table><br><font color="#333333" size="-1">販売会社/広告文責<br>株式会社Hanbit<br>Tel 050-1040-7307</font><style type="text/css">
